import React, { useState} from 'react'
import './domain.css'


export default function Media() {
    const [formData] = useState({
      qn1: [],
      qn2: [],
      qn3: '',
      qn4: '',
      qn5: '',
      qn6: '',
      qn7: '',
      qn8: '',
      qn9: '',
      qn10: '',
    });
  
    // Media.js
const handleSubmit = async (e) => {
  e.preventDefault();

  try {
    const response = await fetch('http://localhost:8000/api/media/submitForm', { // Update the URL
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(formData),
    });

    const data = await response.json();
    console.log(data);
  } catch (error) {
    console.error(error);
  }
};


 
  return (
    <div className="fm">
        <form onSubmit={handleSubmit}>
            <center><h1 className="title">Media and Entertainment</h1></center>
            <div className="qns">
              <center><h1>Fill the following</h1></center>
                <label><b>1. What aspect of media and entertainment are you interested in?</b></label><br/>
                <input type="checkbox" name="qn1" value="qn1" /> Content creation and production <br />
                <input type="checkbox" name="qn1" value="qn1" /> Content distribution and streaming <br />
                <input type="checkbox" name="qn1" value="qn1" /> Audience engagement and analytics <br />
                <input type="checkbox" name="qn1" value="qn1" /> Others <br />
                <label><b>2. What tasks or activities do you want to accomplish using cloud services? </b></label><br/>
                <input type="checkbox" name="qn2" value="qn2" /> Live Video Streaming and Broadcasting <br />
                <input type="checkbox" name="qn2" value="qn2" /> Content Monetization and Subscription Services <br />
                <input type="checkbox" name="qn2" value="qn2" /> News and Media Distribution <br />
                <input type="checkbox" name="qn2" value="qn2" /> Digital Marketing and Advertising <br />
                <input type="checkbox" name="qn2" value="qn2" /> Hosting Website <br />
                <label><b>3. Are you looking to enhance viewer engagement through interactive features like polls and Q&A?  </b></label><br/>
                <input type="text" name="qn3"  /> <br />
                <label><b>4. Would you like to implement a media chatbot for viewer inquiries and support?</b></label><br/>
                <input type="text" name="qn4"  /> <br />
                <label><b>5. Do you require a cloud solution for live streaming and event broadcasting to a global audience?</b></label><br/>
                <input type="text" name="qn5" /> <br />
                <label><b>6. Do you need cloud-based tools for video editing and post-production tasks?  </b></label><br/>
                <input type="text" name="qn6"  /> <br />
                <label><b>7. Do you require a cloud solution for content localization and multilingual subtitles for global audiences?</b></label><br/>
                <input type="text" name="qn7" /> <br />
                <label><b>8. Are you looking for a system to manage digital rights and content licensing for media distribution?</b></label><br/>
                <input type="text" name="qn8" /> <br />
                <label><b>9. Are there any specific geographic regions / requirements for your users?</b></label><br/>
                <textarea name="qn9"></textarea><br/>
                <label><b>10. Are you interested in managing and tracking viewer engagement and viewer feedback effectively?</b></label><br/>
                <input type="text" name="qn10" /> <br />
                <center><button className="btn1">Submit</button></center>
            </div>
        </form>
    </div>
  )
}
